import React from 'react';
import 'tachyons';

const Tabs = () => {
  return (
  	<div className='container'>
  		<div id='tab-1' className='tab-item tab-border'>
  			<i className='fas fa-door-open fa-3x'></i>
  			<p className='hide-sm'>Cancel anytime></p>
  		</div>
  	</div>
  )
}

export default Tabs;
